import Head from 'next/head'
import Link from 'next/link'

export default function header() {
  return (
    <div className="container">
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main>
        <div className="PageHeader">
          <h1 className="title">
            <a>Aman's Blog!</a>
          </h1>
          <div className="TopMenu">
            <ul>
              <li>
                  <Link href="/about">
                    <a>About Me</a>
                  </Link>
              </li>
              <li>
                  <Link href="/blog">
                    <a>Blog</a>
                  </Link>
              </li>
              <li>
                  <Link href="/contact">
                    <a>Contact Me</a>
                  </Link>
              </li>
            </ul>
          </div>
        </div>
      </main>



      <style jsx>{`

        .container {
          min-height: 100vh;
          display: flex;
          width: 100%;
        }

        main {
          display: flex;
          width: 100%;
        }

        .PageHeader {
          align-items: center;
          display: flex;
          margin-left: 5rem;
          width: 100%;
          padding-top: 5rem;
          height: 200px;
          justify-content: space-between;
        }

        .TopMenu {
          margin-right: 5rem;
        }

        .TopMenu > ul {
          list-style-type: none;
          margin: 0;
          padding: 0;
          overflow: hidden;
        }

        .TopMenu > ul > li {
          float: left;
          padding-right: 20px;
        }

        a {
          color: inherit;
          text-decoration: none;
        }

        .title a {
          color: #0070f3;
          text-decoration: none;
        }

        .title a:hover,
        .title a:focus,
        .title a:active {
          text-decoration: underline;
        }

        .title {
          margin: 0;
          line-height: 1.15;
          font-size: 4rem;
        }

        .title,
        .description {
          text-align: left;
        }

        .PageHeader > p {
          line-height: 1.5;
          font-size: 1.5rem;
        }



      `}</style>

      <style jsx global>{`
        html,
        body {
          padding: 0;
          margin: 0;
          font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
            Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
            sans-serif;
        }

        * {
          box-sizing: border-box;
        }
      `}</style>
    </div>
  )
}
